import React from "react";

const ProductCard = ({ nombre, descripcion, precio, marca, modelo, año }) => {
  return (
    <div className=" flex-col h-fit bg-rosa">
      <div className=" flex justify-center">
        <h1 className=" text-5xl font-[Helvetica Neue] font-semibold">
          {nombre}
        </h1>
      </div>
      <div>
        <h2>USD{precio}</h2>
      </div>
    </div>
  );
};

export default ProductCard;
